import React from 'react';
import './App.css';
import Counter from './Counter';
import Greeter from './Greeter';
import MoodToggler from './MoodToggler';
import NavBar from './Navbar';

function App() {
  return (
    <div>
      <Cart />
      <Counter step={5}/>
      <MoodToggler/>
      <NavBar/>
      <Greeter name="Drew" age="62" excitement={4}/>
      <h1>Drew's first app</h1>
    </div>

  );
}

export default App;
